import { Link, Router, Routes, BrowserRouter } from "react-router-dom";
import { MainPage } from "../MainPage";
import styles from "./Header.module.css";
import "../../reset.css"

export const Header = () => {
    return (<ul className={styles.header} role="list">
        <li className={styles.headerLinks}><a href="/" className="headerLinkElement">Login</a></li>
        <li className={styles.headerLinks}><a href="/" className="headerLinkElement">Register</a></li>
        <li className={styles.headerLinks}><a href="/" className="headerLinkElement">About Us</a></li>
        <li className={styles.headerLinks}><a href="/" className="headerLinkElement">Contact Us</a></li>
    </ul>)

}
